import React from "react";

export default function BackToTop() {
  return (
    <div className="nj-scroll-to-top-holder" data-cursor-style="dark">
      <a href="#" data-cursor-effect="hover" id="nj-scroll-to-top">
        Scroll to top
      </a>
    </div>
  );
}
